import React from 'react';

function InvestmentFile() {
  return (
    <div className="investment-file" style={{ padding: '20px', direction: 'rtl' }}>
      <h2>תיק השקעות</h2>
      <p>כאן תוצג מערכת ניהול השקעות – מידע, גרפים ודוחות.</p>
    </div>
  );
}

export default InvestmentFile;
